import Header from './components/Header'
import Board from './components/Board';

import { Grid, Input } from '@mui/material';

import './App.css';

function App() {
  return (
    <div className="background-image">
      <div className='header'>
        <Header></Header>
      </div>
      <Grid container>
        <Grid item xs={0.5}>
        </Grid>
        <Grid item xs={4}>
          <Board></Board>
        </Grid>
        <Grid item xs={7.5}>
          <Input></Input>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
